INSERT INTO `university` VALUES ('5718', '宁波诺丁汉大学', '一本', '2004', '中外合作办学', '浙江省', '19', '0', '计算机科学与技术、建筑环境与设备工程、土木工程、国际经济与贸易、财务管理', '887亩', '浙江省宁波市泰康东路199号', '公交', '5列火车，2趟航班', '1、宁波诺丁汉大学是中国教育部批准的中国第一所引进世界一流大学优质教学资源、具有独立法人资格和独立校区的中外合作大学。 2、学校采用全英文教学，教材从英国诺丁汉大学引进，师资全部由英国诺丁汉大学选聘，采用英国诺丁汉大学教学质量评估体系，共享英国诺丁汉大学网络和教学资源，所有学生均有机会参加不同类型的海外学习项目，颁发英国诺丁汉大学文凭。3、毕业生高质量升学就业，受到全球知名企业和顶尖学府的青睐，是一所中国最国际化的大学。4、为了便于全英语教学，学校录取新生的外语语种为英语，并要求高考英语单科成绩（满分150分）不低于115分，报考英语专业的高考英语单科成绩不低于120分。对于考前及估分填报志愿的省市，要求高考英语单科成绩原则上不低于115分，报考英语专业的高考英语单科成绩原则上不低于120分。\n\n', null);
